    "name": "Hassaku XL (Illustrious)",
    "description": "<p>Hassaku aims to be a anime model with a bright and distinct anime style. <br /><br /><span style=\"color:rgb(193, 194, 197)\"><em>You can run Hassaku XL and use its API on SinkIn: </em></span><a target=\"_blank\" rel=\"ugc\" href=\"https://sinkin.ai/m/JWknjgr\"><span style=\"color:rgb(34, 139, 230)\"><em>https://sinkin.ai/m/JWknjgr</em></span></a><br /></p><p>My <a target=\"_blank\" rel=\"ugc\" href=\"https://discord.gg/zSR5FcYWWE\"><strong>Discord</strong></a> for everything related to anime models and art.<br />If you'd like to support my work, you can do so at: <a target=\"_new\" rel=\"ugc\" href=\"https://subscribestar.adult/citrus-models\"><strong>SubscribeStar</strong></a><strong>,</strong> every bit helps and is truly appreciated!<br /></p><p>____________________________________________________________<br /><br /><strong><u>Supporters:</u></strong></p><p>Thanks to my supporters <strong>tamashiicolle, pttcot</strong>, <strong>SETI </strong>and <strong>Kodokuna</strong><br /></p><p>____________________________________________________________<br /><strong><u>Using the model:</u></strong></p><ul><li><p><span style=\"color:rgb(219, 222, 225)\">The model is trained using images with minimal disruptive elements such as floating text, logos, speech bubbles, and signatures. If any of these elements are present in an image, please include the prompt \"signature\" as a negative prompt</span></p></li><li><p>Metadata and franchise tags are excluded—please do not use them. Tags such as \"highres\" and franchise-related tags like \"re:zero kara hajimeru isekai seikatsu\" are not used in training</p></li><li><p>A CFG of 3 to 7 is recommended, 6 with \"Euler a\", to be more specific</p></li><li><p>Look at the example images, to see how the model should be used</p></li><li><p>Model is trained to be not complicated in use, tag order:<br />First are the number of person, then character names, rest.<br />Example: 1girl, rem \\(re:zero\\), standing, masterpiece, upper body</p></li><li><p>NoobAIs Loras working for the most part better in compare to <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/795765/illustrious-xl\"><span style=\"color:rgb(209, 213, 219)\">Illustrious loras</span></a></p></li><li><p>Here are some <span style=\"color:rgb(242, 242, 242)\">resolution </span>options for SDXL:</p><ul><li><p>1536 x 640</p></li><li><p>1344 x 768</p></li><li><p>1216 x 832</p></li><li><p>1152 x 896</p></li><li><p>1024 x 1024</p></li><li><p>896 x 1152</p></li><li><p>832 x 1216 (most recommended)</p></li><li><p>768 x 1344</p></li><li><p>640 x 1536</p></li></ul></li></ul><p><br />______________________________________________________</p><p><strong><u>Version and License info</u></strong><span style=\"color:rgb(193, 194, 197)\"><u>:</u></span></p><ul><li><p><span style=\"color:rgb(209, 213, 219)\">Below V1 </span>merges <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/260267\">ANIMAGINE XL 3.0</a></p></li><li><p><span style=\"color:rgb(209, 213, 219)\">Version V1 use </span><a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/795765/illustrious-xl\"><span style=\"color:rgb(209, 213, 219)\">Illustrious-XL</span></a><span style=\"color:rgb(209, 213, 219)\"> &amp;</span><a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/827184?modelVersionId=1068947\"><span style=\"color:rgb(209, 213, 219)\"> WAI-NSFW-illustrious-SDXL</span></a><span style=\"color:rgb(209, 213, 219)\"> with additional training</span></p></li><li><p>V2 is trained on its own and don't include any extra merge. Base was <span style=\"color:rgb(209, 213, 219)\">V1</span>, <span style=\"color:rgb(209, 213, 219)\">it is trained to include newer or missing characters. It was also used for further training tests</span></p></li><li><p><span style=\"color:rgb(209, 213, 219)\">V3 is a merge of </span><a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/795765/illustrious-xl\"><span style=\"color:rgb(209, 213, 219)\">Illustrious-XL</span></a><span style=\"color:rgb(209, 213, 219)\"> and V2.2, to fix some issues and was also trained to include newer or missing characters</span></p><p></p><p><span style=\"color:rgb(209, 213, 219)\">All Models using the </span><a target=\"_blank\" rel=\"ugc\" href=\"https://freedevproject.org/faipl-1.0-sd/\"><strong>Fair AI Public License 1.0-SD</strong></a><span style=\"color:rgb(209, 213, 219)\"> license</span>.</p></li></ul><p></p>",
