            "description": "<p>Update, mainly focused on fixing issues from v3.3<br /><br />Better:<br />- Fewer artifacts and less face/eye melting, especially at a distance<br />- Cleaner, less blurry outputs<br />- Additional training on the same dataset af v3.3, some characters working now better<br /><br />What i noticed in 3.3 + now 3.4:<br />- Hair color prompts are less reliable (eye colors gets used for the hair, as example)<br />- Skin can appear extremely bright/shiny again<br />- Multiple views occurs more often<br /></p><p>I believe these issues started after training with Prodigy, it is maybe to agressive. I’ve since switched to ADOPT, and results improved a bit. I may release another update with further fixes and an updated dataset. Problem is that I’m still unsure when Z-Image or Klein will get a proper anime model. I also have several experimental datasets I want to test train, including mixes of natural language and tags (including NSFW, tags combine with natural language, that describe spatial awareness of characters and positions of texts, the exact weakness of tag based models).</p>",
