            "availability": "Public",
            "nsfwLevel": 60,
            "description": "<p>Model was trained on more actual data, but only on a small dataset of 50k images (mostly mihoyo games). With a month of experimenting and a hard reset inbetween, because of better training settings. New characters are relative weak trained in and the style merge mostly erased details of them, in which mostly the clothing suffers. It is more or less a prototype to not make the same mistakes of V2.1, that resulted in sampler problems.<br /></p><p>better (all in compare to 2.1fix)<br />- Less orange looking images<br />- Style is overall more even torwards anime<br />- Model is a bit less restrictive and more expressive<br /><br />worse for some<br />- more anime looking, which also makes backgrounds less detailed and less cohesive<br />- less mature looking faces<br />- Can be darker on some concepts (also more shadows on faces)<br />- Pupils are more filled out (less circle pupils)<br /></p><p>worse<br />- hands/fingers<br />- text (model goes more towards japanese writing, when it wants to generate text, which is disjointed)<br /></p><p>Can't say<br />- Loras should work better, because of a better inner style merge, with much less artifacts. But i can see that a strong style can backup loras to work better. It mostly depends of the loras itself.<br /></p><p>2.1fix have a more 2.5d feel to it, like more details on bodys (like showing rips more often). Which also translate to backgrounds. If you like that, you can still use 2.1fix further. <br />If you question why i can't stay on the same qualitys of 2.1fix, its because i can't be more \"reckless\" in my mergin, without actual hurting the new knowledge in the model. Mergin another model in, erase every training I done on it, because all other models knowing less then my model. While every longer training on it, resets it to be like every other base model like noob or illustriuos, without style merge.</p>",
