            "nsfwLevel": 60,
            "description": "<p>- Trained on up-to-date data, data cut last month. However, characters such as Ye Shunguang (ZZZ) still require many support tags and it will only depict her head right.<br />- Slightly improved prompt adherence.<br />- Brighter faces, less in shadows.<br />- More stable overall output, though somewhat more restrictive.<br />- Fewer unintended multiple-view compositions.<br />- Characters previously trained new in version 3.2 are now better trained in.</p><p><br />Worse:<br />- More sensitive to poorly structured prompts or a low number of prompt tags.<br />- Eye colors may occasionally differ from what is specified in the prompt (can be avoided by lowering cfg to 6).<br />- Style can be more inconsistent on some concepts, especially for characters.</p><p><br />Notes:<br />- Style can be inconsistent, especially for characters. Because the style merge is only strong enough to avoid breaking artist and character tags and that additional loras don't break the model to much.<br />- Use \"Euler a\" as the sampler, this is the sampler the model was primarily tested on.<br />- If only one character is desired, use “1girl” and add “solo” if necessary.<br />- To avoid nsfw art, put \"nude\" into the negative</p><p><br />The model was additional trained longer on a more unbiased dataset.<br />Now trained on bf16, prodigy with simplified ademamix, Factored + stochastic rounding, OrthoGrad to prevent overfitting and active Kourkotas Beta.</p>",
