            "description": "<p>This update focuses on resolving many of the issues present in version V3, while also serving as a more general-purpose base model. The most noticeable change is the change toward a toned-down anime style, leaning closer to Style A, but with some of the visual changes of later updates. Model is also more lora friendly, because of the more base model nature (noob based loras).<br /><br />Next update: The model displays noticeable noise on some concepts. I'm working to reduce this effect.</p><p><br />Changes in compare to hassaku V3:<br />- Fixed the issue where prompts with fewer than 75 tokens produced poorer results<br />- The overall visual style is significantly toned down — less glossy or “shiny”<br />- Certain tags like \"Mature female\" now produce more accurate results<br />- Slight improvements for furry-related prompts<br />- Better handling of chibi and pixel art styles<br />- Model has been trained further on more recent data (characters like Varesa from Genshin now work using her tag alone)<br />- Significantly reduced chances of extreme brightness, discoloration, or overly orange/dark results<br />- Reduced orange/sepia tint on many concepts (including yellowish bodys)<br />- Better working artist tags<br />- Better results for more niche or abstract prompts, not just common ones like “1girl”</p><p>Worse for some:<br />- Composition is less restrictive: As example, other models mostly place multiple characters in a row, sitting or standing on tags 4girls or 5girls. My model creates more complex layouts. While this creates more variety, it also increases the chance of failed images (messy limbs, missplaced Bodyparts)<br />- The model is less biased toward closer images, often generating wider scenes</p><p>Worse:<br />- Some concepts may look less detailed or simplified, especially those involving characters<br />- More appearance of multiple views (if this happen, put it into the negatives)<br />- Colors are less vibrant<br />- Bodies are sometimes to bright<br /></p><p>Note to new characters:<br />Many of the newer characters still require supporting tags to generate them more accurately</p><p>Note2 if some are interested: <br />Adding new characters and up-to-date knowledge is not as simple as it may seem, especially if you want to avoid bias. For example, every cow-girl might end up resembling Varesa (from Genshin). Avoiding that takes a lot of time. Even now, cow horns having still a bias torwards her horns.<br /><br />Note3:<br />Some loras that worked on V1 before, now work on V3 barerly at all or on low strengh, because of further training.<br /><br />Data-cut early September, adding data in the training progress. Some characters like alice_(genshin_impact) will not work, even if already included.</p>",
