            "description": "<p>Be aware that this is a WIP model, WIP means mostly the knowleghe of new characters, outsite of that, it is a full working model, but there is still work on it to do.<br /><br />The model occasionally performs better when using more than 75 tokens and it also creates a bit to detailed/realistic shiny/glossy bodys currently, both will change in a later update.<br /><br />Model is training on changing datasets, ranging from 120k to around 760k images. The primary learning dataset (70k images) included characters from the past year (01.06.2024 of last year to now), with at least 100 images on Danbooru. The learning dataset was heavily filtered by score and quality, compressing it to a relative small size of 70k images. Note: While the most recent characters from the last week are included, they are not yet trained well enough to be reliable (like Sameko Saba).</p><p><br />In Detail:<br />Over the past two months, I ran into several issues. After about two weeks of training, the model began to deteriorate rapidly for no apparent reason.</p><p>As a result, I had to do one hard reset and two soft resets during the process, effectively throwing away a lot of time, effort, and money. I only discovered the root cause at the beginning of this month. So, this current version is still mid-training. It mainly includes faces and hairstyles of new characters, while clothing is still in the process to get learned for the most part. I'm sharing it now despite the state it's in, as I'm already 2 months over my schedule now.</p><p>This model has a style merge, which can sometimes lead to artifacts on the eyes, especially viewed from a distance. This aligns what other models are doing.</p>",
