            "description": "<p>The pure trained model output. Completly unaltered, as Nature intended.<br /><strong>This model does not have any style merge stabilisation </strong>and is intended as base for further training, merges, using Loras, etc. for anyone, that are interested in that.<br /><br />Be aware that it can have every kind of problem, a base model can have.<br />But it have a little specialty to it, the style got natively trained into the model, instead of merging it into the model per loras. It enhance the default output of the pure model.<br />If you compare it with 3.1, you will notice some similar looking images, because of the low style merge of 3.1 itself. In some cases, this pure model may produce better looking images, but it can also create significantly worse images. Results will vary greatly.<br /><br />It have one trained epoch more (400k images -&gt; not a big differece) in, in compare to 3.1. <br />With slitly changed training:<br />Trained now on LION, with Stochastic Rounding, <a target=\"_blank\" rel=\"ugc\" href=\"https://arxiv.org/abs/2412.08894\">SMMF, </a><a target=\"_blank\" rel=\"ugc\" href=\"https://github.com/kyleliang919/C-Optim\">C-Optim</a> and higher Alpha1. Before with adafactor Stochastic Rounding and Fused Back Pass.</p>",
