            "availability": "Public",
            "nsfwLevel": 60,
            "description": "<p>It behaves and looks mostly like Style A, less flat looking but also more drawn in a way. Model style is now build up from the ground up, without any other merge, like mergin with wai, simply to actualy update my model on new concepts. Because of that, its basicly a new model and a bit less stable in compare to style A.</p><p>Don't expect, because its named V2, thats magicaly much better. When you train, merge or make any changes, it tends to impact other concepts significantly. V2 means a new base to work on.<br /></p><p>Compared to 1.3 A, a honest review over my own model:<br /><br />Improvements:<br />- Better at prompt following <br />- Clearer images with less of a \"fog\" over the image (for concepts that had that)<br />- Slightly better at handling furry-related prompts<br />- For most concepts, more filled and coherent backgrounds<br />- Better at artist tags<br /></p><p>Improvements for some:<br />- Model have a bit more freedom and variety, that comes also with a wider array of style on a singe concept (some images are more detailed and others are more flat on the same prompt)<br />- Stronger contrast, but some concepts have a yellow tint<br />- Bodys have more details, with less 2d flatness, featuring a slight shine and sometimes stronger outlines<br />- Faces appear slightly more mature<br />- It likes to draw fingernails more often<br /></p><p>Worse:<br />- Nights are less dark<br />- Some images can look overexposed or \"burnt\" on color<br />- Bodys, because they are more detailed, can look washed out, at some prompt combinations<br />- Artifacts are more frequent; slightly worse than style A, but much better in compare to style B<br />- Eyes forming less well-formed pupils (dependent on concept and character distance), in combi with more artifacts, makes it harder to have clear eyes. A point to use Style A over V2. But it also have a bit to do, that faces are more mature looking and having smaller eyes with it.<br />- Looks sometimes \"dirty\"<br />- A bit more unstable<br /></p><p>The model was further trained on an dataset of around 60k (more recent characters) to 600k (total images).<br /><br />Will work first on a update, to make eyes, lines and overall look more clear and harmonic</p>",
