            "description": "<p>Because my 2.2 Version needs a bit more time then expected. I made this fixed version of 2.1. Issues of this version was a to high style merge overall, resulting in unexpected issues with samplers and unwanted side effects.<br /><br />I reduced the style merge significatly and merged style A in, because style A is overall more liked. Not only because its more stable, but also for its simpler but still detailed style.<br /><br />2.1fix should have a lot less issues sampler side and resembles style A more or less in some aspects. Drawback of mergin A back is, that newer characters are getting erased in this fixed version. But that seems for most not that big of a problem, especially with the use of loras.<br /><br />Note: Fixed Style is weaker on the fix version, the variety of different styles that can appear is much higher. If you don't like that faces can appear more realistic, put nose into the negatives.</p>",
