            "nsfwLevel": 60,
            "description": "<p>This model was trained on more up-to-date data, it can be considered between Illustrius and NoobAI-XL in terms of its look.</p><p>It don't have a strong style merge, like Wai or NTR, to have stronger responding artist tags.</p><p>The base model is Illustrious-XL, trained on a dataset ranging from 70k to 440k images (to update Illustrious-XL), primarily making sure that newer Genshin characters, ZZZ and Wuthering Waves characters are trained in.</p><p>It was later merged with WAI-NSFW-illustrious-SDXL, to achieve a more consistent style, but it loses a bit of my character training, like details on clothes (and loses appearence of characters with lower image counts).</p><p>If you want 1to1 clothes like of newer characters from ZZZ, the clothes are mostly off and wrong in detail, i will fix that in the next version.</p>",
